window.bookSummaryJSON = "Set in the Dorset landscape familiar to Hardy novels, <i>The Woodlanders</i> concerns the fortunes of Giles Winterborne, whose love for the well-do-do Grace Melbury is challenged by the arrival of a dashing and dissolute doctor, Edred Fitzpiers. When the mysterious Mrs Charmond further complicates the romantic entanglements, marital choice and class mobility become inextricably linked."; 
